func TestParseOutdatedOutput_InvalidJson(t *testing.T) {
	vector := "[\"latest_version\"]"

	verb, format := formats.DetectVerbAndFormat(vector)
	assert.Equal(t, formats.OutdatedCommand, verb)
	assert.Equal(t, formats.JsonFormat, format)

	result, err := ParseOutdatedOutput(vector)
	assert.NotNil(t, err)
	assert.Contains(t, err.Error(), "unable to parse JSON")
	assert.Zero(t, len(result))
}
